import { LIST_GROUPS } from "../actions/ActionTypes";

export default function(state = {}, action) {
  switch (action.type) {
    case LIST_GROUPS:
      return Object.assign({}, state, {
        ngoGroups: action.payload
      });
    default:
      return state;
  }
}
